import React from "react";
import { DivWrapper } from "./Div Wrapper/DivWrapper";
import { Footer } from "./Footer/Footer";
import { Frame } from "./Frame/Frame";
import { FrameWrapper } from "./Frame Wrapper/FrameWrapper";

export const LabOverview = () => {
  return (
    <div className="bg-[#fbfbfb] flex flex-col items-center w-full min-h-screen">
      <div className="bg-[#fbfbfb] w-full max-w-7xl p-4 relative">

        {/* Breadcrumb */}
        <div className="flex items-center space-x-2 mt-10">
          <img src="/path-to-icon/group.png" alt="Home" className="w-4 h-4" />
          <img src="/path-to-icon/arrow-down.svg" alt=">" className="w-4 h-4" />
          <span className="text-xs text-gray-500">Labs</span>
          <img src="/path-to-icon/arrow-down.svg" alt=">" className="w-4 h-4" />
          <span className="text-xs text-gray-500">EMC test labs</span>
          <img src="/path-to-icon/arrow-down.svg" alt=">" className="w-4 h-4" />
          <span className="text-xs text-black font-medium">Mestco Energy Solution</span>
        </div>

        {/* Frame at the top */}
        <Frame />

        {/* Main Content Row: Sidebar + FrameWrapper */}
        <div className="flex mt-10 gap-6">

          {/* Sidebar Menu */}
          <div className="bg-white shadow-md rounded-2xl p-5 w-72 h-fit">
            <div className="flex items-center space-x-2">
              <img src="/path-to-icon/menu.svg" alt="Menu" className="w-6 h-6" />
              <h2 className="text-lg font-bold text-gray-800">Profile Menu</h2>
            </div>

            <div className="mt-4 space-y-2">
              {[
                "Additional Locations",
                "Test Lab Capabilities",
                "Testing Standards",
                "Latest News",
                "Social Links"
              ].map((item, index) => (
                <div
                  key={index}
                  className={`p-3 rounded-lg ${
                    index === 0
                      ? "border-l-4 border-red-600 font-bold text-red-600"
                      : "text-gray-700 font-medium"
                  } hover:bg-gray-100`}
                >
                  {item}
                </div>
              ))}
            </div>
          </div>

          {/* Right side content */}
          <div className="flex-1">
            <FrameWrapper />
          </div>
        </div>

        <div className="mt-10">
  <DivWrapper />
</div>
        <Footer />
      </div>
    </div>
  );
};
